const {createCanvas, Image} = require('canvas')
var CryptoJS = require("crypto-js");

const canvas = createCanvas(400, 200)
const ctx = canvas.getContext('2d')

const src = "data:image/jpeg;base64,"
var c = "eGVL2Oo8oTZd8xvEWJVB7zUQGhREm2iWpwjB9Ihcs97F6qmEGPs8Kvr9qK8CQM++lc2xUah+ucaZ56PPTnWdlnXfsAOpKTTwI+FT5dd/rDSLlT7OozA7ux/brySDwlJYr480MdrNaR0i7E/PFw=="
var t = CryptoJS.enc.Utf8.parse("dtadtadta")
    , a = CryptoJS.RC4.decrypt(c, t);
t = CryptoJS.enc.Utf8.stringify(a).split(",")

function main() {
    var result;
    var image = new Image()
    image.src = src
    ctx.drawImage(image, 0, 0, 400, 200);
    for (var n = {}, c = 0; c < t.length; c++)
        n[15 * parseInt(t[c]) / 1.5] = ctx.getImageData(15 * c / 1.5, 0, 15 * (c + 1) / 1.5, 200);
    for (var i in n) {
        var s = n[i];
        ctx.putImageData(s, i, 0)
    }
    result = canvas.toDataURL()
    return result
}

console.log(main())
